import React from "react";
import  NavBarStyle from "./Style/NavBarStyle"


class NavBar extends React.PureComponent {
    constructor(props) {
        super(props);
        this.state = {
          error: null,
          isLoaded: false,
        };
      }


      render() {
        return (
        <NavBarStyle>
            <div style={{height:'100%'}}></div>
        </NavBarStyle>
        )
      }
}


export default NavBar;
